import { motion } from 'framer-motion'

export default function About() {
    return (
    <motion.div 
        animate={{ x: 100, y: 100, opacity: 1 }}
        transition={{
          delay: 1,
          x: { type: "spring", stiffness: 100 },
          default: { duration: 2 },
        }}
        exit={{ opacity: 0 }} 
        id="about-content" 
        className="content">
        ABOUT
    </motion.div> 
  )
}
